var iconNames = [];
for (var index = 0; index < icons.length; index++) {
    iconNames.push(icons[index]['name']);
}

const Icon = styled.div`
    height: 100%;
    display: grid;
    align-items: center;
    justify-items: center;
    /* &.Dark {filter: invert(0);} */
    &.Light {
        filter: invert(1);
    }
`;

interface Props {
    name: string;
    color: string;
}

interface State {
    svg: any;
}
var iconRendered = null;

export class LargeIcon extends React.Component<Props> {
    static defaultProps = {
        name: icons[0]['name'],
        color: 'Light'
    };

    state = {
        svg: icons[0]['svg']
    };

    static propertyControls: PropertyControls = {
        name: {
            type: ControlType.Enum,
            title: 'Icon',
            options: iconNames
        },
        color: {
            type: ControlType.SegmentedEnum,
            title: 'Color',
            options: ['Light', 'Dark']
        }
    };

    render() {
        icons.map(icon => {
            if (icon.name == this.props.name) {
                this.state.svg = icon.svg;
            }
        });
        iconRendered = this.state.svg;
        return <Icon className={`icon ${this.props.color}`}>{this.state.svg}</Icon>;
    }
}
